import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
    state = {
      monsters: [
         {
          name: 'Linda',
          id: "1feasdbhb"
        },
        {
          name: 'Frank',
          id: "1feasdbaehb"
        },
        {
          name: 'Jacky',
          id: "3feazxcsdbhb"
        },
      ]

    }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map( (monster) => {
            return <div key={monster.id}>
              <h1>{monster.name}</h1>
              </div>
          })
        }
      </div>
    );
  }
}

export default App;
